import React from "react";

import { ContainerPage, TittlePage } from "../../components/Main";

const Page = () => {
    return (

        <ContainerPage>

            <TittlePage>
            <h3><strong>Olá!</strong><br /> Bem-vindo(a) à plataforma de eventos da empresa!<br />Aqui, você vai
                    encontrar inúmeros eventos para participar,<br />dentre eles estão palestras, mentorias, workshops e etc.<br />Mas
                    primeiro, nos diga quais as suas principais áreas de interesse,<br />Aqui você pode incluir tudo se preferir:</h3>                    
    
            </TittlePage>


        </ContainerPage>

    );
}

export default Page;
